import web from "../src/Images/photo1.jpg";
import App from "../src/Images/photo3.jpg";
import Android from "../src/Images/photo7.webp";
import Digital from "../src/Images/photo4.png";
import Marketing from "../src/Images/photo5.jpg";
import Software from "../src/Images/photo6.jpg";

const SData=[
    {
        imgsrc:web,
        title:"Web Development",
        btname:"Web Course",
        about:"Web development refers to the creating, building, and maintaining of websites. It includes aspects such as web design, web publishing, web programming, and database management."
    },
    {
        imgsrc:App,
        title:"App Development",
        btname:"App Course"
    }, 
    {
        imgsrc:Android,
        title:"Android Development",
        btname:"Android Course"
    }, 
    {
        imgsrc:Digital,
        title:"Digital Marketing",
        btname:"Digital Course"
    }, 
    {
        imgsrc:Marketing,
        title:"Marketing",
        btname:"Marketing Course"
    }, 
    {
        imgsrc:Software,
        title:"Software Developer",
        btname:"Software Course"
    }
]

export default SData;
